import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { wrapperStyle } from "./styles.jsx";
import { Home, Aperture, ShutterSpeed, ISO } from "./pages.jsx";
import Navigation from "./navigation.jsx";
import logo from "./../src/emblema/logo.svg";
import Clock from "./Digital_Clock/clock.js";
import "./style_h1.css";

export function App() {
  // function App() {
  return (
    <BrowserRouter>
      <div style={wrapperStyle.wrapper}>
        <Navigation />
        <div className="grid-container">
          <div className="item-a">
            <img src={logo} className="App-logo" alt="logo" />
            <h6>Power by React</h6>
          </div>
          <div className="item-b">
            <h1>Советы по работе с камерой</h1>
          </div>
          <div className="item-c">
            <div className="Clock">
              <Clock />
            </div>
            <h6>Powered by React state</h6>
          </div>
        </div>

        <Routes>
          <Route exact path="/aperture" element={<Aperture />} />
          <Route exact path="/shutterspeed" element={<ShutterSpeed />} />
          <Route exact path="/iso" element={<ISO />} />
          <Route exact path="/" element={<Home />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}
